<?php die(); ?>#(^-^)#{"__meta":{"id":"X72000f0b440772cecf4073655ba213ee","datetime":"2022-07-23 17:02:47","utime":1658575967.105425,"method":"POST","uri":"\/aisha\/administrator\/index.php?option=com_content&layout=edit&id=564","ip":"::1"},"info":{"phpVersion":"7.4.30","joomlaVersion":"4.1.5","requestId":"X72000f0b440772cecf4073655ba213ee","identity":{"type":"user","id":222,"name":"Astro Isha","username":"luffy22"},"response":{"status_code":200},"template":{"template":"atum","home":"","id":""},"database":{"dbserver":"mysql","dbversion":"8.0.29-0ubuntu0.20.04.3","dbcollation":"utf8mb4_0900_ai_ci","dbconnectioncollation":"utf8mb4_0900_ai_ci","dbconnectionencryption":"","dbconnencryptsupported":true}},"memory":{"peak_usage":4771048,"peak_usage_str":"5MB"},"request":{"$_GET":"array:3 [\n  \"option\" => \"com_content\"\n  \"layout\" => \"edit\"\n  \"id\" => \"564\"\n]","$_POST":"array:5 [\n  \"jform\" => array:29 [\n    \"title\" => \"Yupa Yoga\"\n    \"alias\" => \"yupa-yoga\"\n    \"articletext\" => \"\"\"\n      <div class=\"mb-3\">&nbsp;<\/div>\\r\\n\n      <div class=\"lead alert alert-dark\">What is Yupa Yoga?<\/div>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yupa Yoga comes under Akriti Yogas of the Nabhasha Yogas mentioned in B. V. Raman's 300 Important Combinations. Nabasha Yogas is described in other old astrological texts also like Brihat Jataka and Brihat Parashara Hora Shastra(BPHS).<\/p>\\r\\n\n      <div class=\"lead alert alert-dark\">How is Kulvardhana Yoga formed?<\/div>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yupa Yoga is a very simple yoga formed when seven planets including Sun, Moon, Mars, Mercury, Jupiter, Venus and Saturn occupy first four houses. All these seven planets should occupy:<\/p>\\r\\n\n      <ol>\\r\\n\n      <li>First House(ascendant)<\/li>\\r\\n\n      <li>Second House<\/li>\\r\\n\n      <li>Third House<\/li>\\r\\n\n      <li>Fourth House<\/li>\\r\\n\n      <\/ol>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First thing to count is distance of Jupiter from Saturn. If Saturn and Jupiter are separated by five signs than this yoga cannot occur. For example if Saturn enters Pisces and Jupiter travels to Cancer than this yoga will not occur.<\/p>\\r\\n\n      <div class=\"lead alert alert-dark\">Examples Of Yupa Yoga<\/div>\\r\\n\n      <ul class=\"nav nav-pills\">\\r\\n\n      <li class=\"nav-item\"><a href=\"#north-564\" class=\"nav-link active\" data-toggle=\"tab\">North Style<\/a><\/li>\\r\\n\n      <li class=\"nav-item\"><a href=\"#south-564\" class=\"nav-link\" data-toggle=\"tab\">South Style<\/a><\/li>\\r\\n\n      <\/ul>\\r\\n\n      <div class=\"tab-content\">\\r\\n\n      <div class=\"mb-3\">&nbsp;<\/div>\\r\\n\n      <div id=\"north-564\" class=\"tab-pane active\"><img src=\"images\/yoga_img\/kulvardhana_yoga_n.jpg\" alt=\"kulvardhana\" title=\"kulvardhana yoga north\" \/><\/div>\\r\\n\n      <div id=\"south-564\" class=\"tab-pane\"><img src=\"images\/yoga_img\/kulvardhana_yoga_s.jpg\" alt=\"kulvardhana\" title=\"kulvardhana yoga south\" \/><\/div>\\r\\n\n      <\/div>\\r\\n\n      <div class=\"mb-3\">&nbsp;<\/div>\\r\\n\n      <div class=\"lead alert alert-dark\">Results of Yupa Yoga<\/div>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yupa Yoga gives a charitable and noble nature. It also makes one adopt a liberal approach to life. He\/She is calm, confident and in control of one's feelings.<\/p>\\r\\n\n      <div class=\"lead alert alert-dark\">Remarks on Yupa Yoga<\/div>\\r\\n\n      <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;B. V. Raman does not think too highly of Akriti Yogas of which Yupa Yoga is a part. He thinks they don't contribute much to the success of an individual. According to B. V. Ramam they give a better idea about means of livelihood a person will have.<\/p>\n      \"\"\"\n    \"transition\" => \"\"\n    \"state\" => \"1\"\n    \"catid\" => \"14\"\n    \"featured\" => \"0\"\n    \"access\" => \"1\"\n    \"language\" => \"*\"\n    \"note\" => \"\"\n    \"version_note\